import React from "react";

const Titles = () => (
    <div>
        <h1 className="title-container__title">Jordan's WebApp</h1>
        <h5 className="title-container__subtitle">A simple login application with react frontend, spring boot backend, and h2 database using JbdcTemplate</h5>
    </div>
);

export default Titles;
